var box_length = 10;

// create an engine
var engine = Engine.create();

// create a renderer
var render = Render.create({
    canvas: document.getElementById("canvas"),
    engine: engine,
	options: {
			wireframes: false,
            width: 800,
            height: 600,
            background: '#ffffff'
        }
});

// add mouse control
var mouse = Matter.Mouse.create(render.canvas),
    mouseConstraint = Matter.MouseConstraint.create(engine, {
        mouse: mouse,
        constraint: {
            stiffness: 0.2,
            render: {
                visible: false
            }
        }
    });

Composite.add(engine.world, mouseConstraint);

// keep the mouse in sync with rendering
render.mouse = mouse;

function rgb(rgb) {
	return "rgba(" + rgb[0].toString() + "," + rgb[1].toString() + "," + rgb[2].toString() + ",1)";
}

var ground1 = Bodies.rectangle(0, 600, 1600, 10, { isStatic: true, render: { fillStyle: '#ffffff' } });
var ground2 = Bodies.rectangle(0, 0, 10, 1200, { isStatic: true, render: { fillStyle: '#ffffff' } });
var ground3 = Bodies.rectangle(849, 0, 100, 1600, { isStatic: true, render: { fillStyle: '#ffffff' } });

var container1 = Bodies.rectangle(350, -100, 10, 300, { isStatic: true, render: { strokeStyle: '#abcdef' } });
var container2 = Bodies.rectangle(450, -100, 10, 300, { isStatic: true, render: { strokeStyle: '#abcdef' } });
var container3 = Bodies.rectangle(350, 110, 10, 90, { isStatic: true, render: { strokeStyle: '#abcdef' } });
var container4 = Bodies.rectangle(450, 110, 10, 90, { isStatic: true, render: { strokeStyle: '#abcdef' } });
var container5 = Bodies.rectangle(510, 70, 120, 10, { isStatic: true, render: { strokeStyle: '#abcdef' } });
var door = Bodies.rectangle(400, 57, 120, 10, { render: { fillStyle: '#abcdef' } });
var ball1 = Bodies.circle(400, 20, 40, { render: { fillStyle: '#abcdef' } });
var ball2 = Bodies.circle(400, -30, 40, { render: { fillStyle: '#abcdef' } });
var ball3 = Bodies.circle(400, -120, 40, { render: { fillStyle: '#abcdef' } });

var objects = [ground1, ground2, ground3, container1, container2, container3, container4, container5, door, ball1, ball2, ball3];
for (let y = 0; y < image.length; y++) {
	for (let x = 0; x < image[0].length; x++) {
		let xpos = (x * box_length) + 150
		let ypos = y * (box_length - 1) + (300 - box_length * box_length);
		let box = Bodies.rectangle(xpos, ypos, box_length, box_length,
			{ render: { fillStyle: rgb(image[x][y]) } });
		objects.push(box);
	}
}



// add all of the bodies to the world
Composite.add(engine.world, objects);

// run the renderer
Render.run(render);

// create runner
var runner = Runner.create();

// run the engine
Runner.run(runner, engine);